import React, {useEffect} from 'react'
import { connect } from 'react-redux';

import { StyleSheet, Text, View } from 'react-native';

import {uploadCats} from '../../redux/kats/kats.actions'


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});


function KatsOverview({uploadCats}) {




	return (
		<View style={styles.container}>
	      <Text>Open up !</Text>
    	</View>
		)
}

const mapDispatchToProps = dispatch => ({
  uploadCats: () => dispatch(uploadCats())
})

export default connect(null, mapDispatchToProps)(KatsOverview);
